import{_ as e,c as r,o as a,a as t}from"./app.7251b36b.js";const b=JSON.parse('{"title":"\u307D\u3059\u3055\u3093\u30D6\u30ED\u30B0\u306B\u3064\u3044\u3066\u601D\u3063\u3066\u3044\u308B\u3053\u3068","description":"","frontmatter":{"title":"\u307D\u3059\u3055\u3093\u30D6\u30ED\u30B0\u306B\u3064\u3044\u3066\u601D\u3063\u3066\u3044\u308B\u3053\u3068","lang":"ja-JP"},"headers":[],"relativePath":"xiupos.md"}'),i={name:"xiupos.md"},s=t('<h1 id="xiupos" tabindex="-1">xiupos <a class="header-anchor" href="#xiupos" aria-hidden="true">#</a></h1><p>Misskey \u3068\u3044\u3046 SNS \u3067\u4EA4\u6D41\u306E\u3042\u308B\u300C\u307D\u3059\u3055\u3093\u300D\u3053\u3068\u300Cxiupos \u3055\u3093\u300D\u306E\u30D6\u30ED\u30B0\u3092\u62DD\u898B\u3057\u305F. <a href="https://xiupos.net/" target="_blank" rel="noopener noreferrer">Xiupoy blog</a><br> \u60B6\u307E\u3057\u305F. \u826F\u3059\u304E\u308B.<br> \u5199\u771F\u306E\u305A\u3070\u629C\u3051\u305F\u7DBA\u9E97\u3055\u3084\u5207\u308A\u53D6\u308A\u306E\u4E0A\u624B\u3055\u306F\u3082\u3061\u308D\u3093, \u6587\u7AE0 1 \u3064 1 \u3064\u3082\u5FC3\u60F9\u304B\u308C\u308B.<br> \u30B7\u30F3\u30D7\u30EB\u3067\u3042\u308B\u3053\u3068\u306F\u7F8E\u3057\u3044\u3092\u4F53\u73FE\u3057\u305F\u304B\u306E\u3088\u3046\u306A\u30D6\u30ED\u30B0.</p><p>\u660E\u3089\u304B\u306B\u4ED6\u306B\u306A\u3044\u4F55\u304B\u3092\u611F\u3058\u305F.</p><h1 id="\u81EA\u5206\u3067\u4F5C\u308A\u305F\u3044" tabindex="-1">\u81EA\u5206\u3067\u4F5C\u308A\u305F\u3044 <a class="header-anchor" href="#\u81EA\u5206\u3067\u4F5C\u308A\u305F\u3044" aria-hidden="true">#</a></h1><p><a href="https://misskey.usuyuki.net/notes/92bvqooypb" target="_blank" rel="noopener noreferrer">Misskey \u3067\u306E\u3064\u3076\u3084\u304D</a></p><blockquote><p>\u5FC3\u52D5\u304B\u3055\u308C\u308B\u3082\u306E\u3092\u898B\u305F\u6642\u306B\u3001\u81EA\u5206\u3082\u4F5C\u308A\u305F\u3044\u3063\u3066\u601D\u3048\u308B\u4EBA\u9593\u306A\u306E\u3067</p></blockquote><p>\u3068\u3044\u3046\u3053\u3068\u3067\u4F5C\u3063\u305F\u306E\u304C\u3053\u3053.<br> \u307D\u3059\u3055\u3093\u3092\u771F\u4F3C\u3066\u53E5\u8AAD\u70B9\u3092\u30B3\u30F3\u30DE\u30D4\u30EA\u30AA\u30C9\u306B\u3057\u305F\u308A,\u3060\u30FB\u3067\u3042\u308B\u8ABF\u306B\u3057\u305F\u308A.<br> \u672C\u5BB6\u306F VuePress \u306A\u3093\u3060\u3051\u3069, \u6298\u89D2\u306A\u306E\u3067\u305D\u306E\u5F8C\u7D99\u306E VitePress \u3092\u4F7F\u3063\u305F\u308A.</p><p>\u30AB\u30E1\u30E9\u306F\u306A\u3044\u306E\u3067, \u3044\u3064\u304B\u8CB7\u3044\u305F\u3044.<br> \u3067\u3082\u5F53\u305F\u308A\u524D\u306A\u306E\u3060\u304C, \u6587\u7AE0\u3068\u304B\u771F\u4F3C\u3057\u3066\u5F97\u3089\u308C\u308B\u3082\u306E\u306E\u57DF\u3092\u8D85\u3048\u3066\u308B\u306E\u3067, \u904B\u7528\u3067\u30AB\u30D0\u30FC\u3057\u305F\u3044.</p><p>\u4ECA\u66F4\u3060\u3051\u3069, \u30DD\u30B9\u3055\u3093\u306B\u7FD2\u3063\u3066 Hugo \u306B\u3057\u3061\u3083\u3063\u305F\u65B9\u304C\u826F\u304B\u3063\u305F\u6C17\u3082\u3057\u3066\u304D\u305F.<br> VitePress \u3060\u3068, \u60C5\u5831\u5C11\u306A\u304F\u3066,Vue \u89E6\u3063\u305F\u3053\u3068\u7121\u3044\u8EAB\u3068\u3057\u3066\u306F\u30C6\u30FC\u30DE\u4F5C\u308B\u306E\u3082\u8170\u304C\u91CD\u3044.</p><h1 id="\u307D\u3059\u3055\u3093\u3063\u307D\u3044\u30D6\u30ED\u30B0\u306E\u305F\u3081\u306E-tips" tabindex="-1">\u307D\u3059\u3055\u3093\u3063\u307D\u3044\u30D6\u30ED\u30B0\u306E\u305F\u3081\u306E tips <a class="header-anchor" href="#\u307D\u3059\u3055\u3093\u3063\u307D\u3044\u30D6\u30ED\u30B0\u306E\u305F\u3081\u306E-tips" aria-hidden="true">#</a></h1><ul><li>\u53E5\u8AAD\u70B9\u3092\u30B3\u30F3\u30DE\u30D4\u30EA\u30AA\u30C9\u306B(,\u306E\u3042\u3068\u306F\u534A\u89D2\u30B9\u30DA\u30FC\u30B9)</li><li>\u3060\u30FB\u3067\u3042\u308B\u8ABF\u306B\u3059\u308B</li><li>1 \u6587\u3092\u77ED\u304F\u3059\u308B</li><li>\u900F\u660E\u611F\u306E\u3042\u308B\u30A8\u30E2\u304F\u3066\u7DBA\u9E97\u306A\u5199\u771F\u3092\u9593\u306B\u631F\u3080</li><li>\u7A4D\u6975\u7684\u306A\u51FA\u5178\u660E\u8A18</li><li>\u5F15\u7528\u306E\u756A\u53F7\u3068\u30EA\u30F3\u30AF\u3092\u964D\u308B<br> \u4ED6\u3001\u4ED8\u3051\u713C\u304D\u5203\u3067\u3069\u3046\u306B\u3082\u306A\u3089\u306A\u3044\u90E8\u5206\u591A\u6570.</li></ul>',11),o=[s];function p(n,l,_,d,h,u){return a(),r("div",null,o)}var f=e(i,[["render",p]]);export{b as __pageData,f as default};
